import React, { useEffect, useState } from "react";
import {
  InputLabel,
  MenuItem,
  TextField,
  FormControl,
  Select,
} from "@mui/material";
import loanDataService from "../../Company/Service";
import { useNavigate, useParams } from "react-router-dom";
import CompanyModal from "./CompanyModal";
function UpdateCompany() {
  const [companyTypes, setCompanyTypes] = useState([]);
  const [entityTypes, setEntityTypes] = useState([]);
  const [toggle, setToggle] = useState(true);
  const [toggleContactInfo, setToggleContactInfo] = useState(true);

  const { Id } = useParams();
  const [company, setCompany] = useState({
    Id: Id,
    Name: "",
    NoOfBranch: "",
    EstablishmentYear: "",
    TINNumber: "",
    TINCertificate: "",
    CompanyTypeID: "",
    VATNumber: "",
    VATCertificate: "",
    EntityTypeID: "",
    Address: {
      Id: "",
      Country: "",
      Region: "",
      ZoneSubCity: "",
      Woreda: "",
      City: "",
      Kebele: "",
      HouseNo: "",
      BuildingNo: "",
      StreetAddress: "",
    },
    // AccountInfo: {
    //   Id:"",
    //   AccountNo:"",
    //   CustomerId:"",
    //   Branch:"",
    //   District:"",
    //   Other:""
    // },
    // ContactInformation:{
    //   Id:"",
    //   DesignatedPersonFName:"",
    //   DesignatedPersonMName:"",
    //   DesignatedPersonLName:"",
    //   Position:"",
    //   MobileNo:"",
    //   Telephone:"",
    //   Email:""
    // }
  });
  const upadteCompanyById = () => {
    loanDataService
      .getCompanyById(Id)
      .then((res) => {
        setCompany({
          ...company,
          Name: res.data.Result.Name,
          NoOfBranch: res.data.Result.NoOfBranch,
          EstablishmentYear: res.data.Result.EstablishmentYear,
          TINNumber: res.data.Result.TINNumber,
          TINCertificate: res.data.Result.TINCertificate,
          CompanyTypeID: res.data.Result.CompanyTypeID,
          VATNumber: res.data.Result.VATNumber,
          VATCertificate: res.data.Result.VATCertificate,
          EntityTypeID: res.data.Result.EntityTypeID,
          Address: {
            Id: res.data.Result.Address.Id,
            Country: res.data.Result.Address.Country,
            Region: res.data.Result.Address.Region,
            ZoneSubCity: res.data.Result.Address.ZoneSubCity,
            Woreda: res.data.Result.Address.Woreda,
            City: res.data.Result.Address.City,
            Kebele: res.data.Result.Address.Kebele,
            HouseNo: res.data.Result.Address.HouseNo,
            BuildingNo: res.data.Result.Address.BuildingNo,
            StreetAddress: res.data.Result.Address.StreetAddress,
          },
        });
        debugger;
      })
      .catch((err) => console.log(err));
  };
  useEffect(() => {
    upadteCompanyById();
  }, []);
  const fetchCompanies = () => {
    loanDataService
      .getCompanyType()
      .then((response) => {
        console.log(response.data.Result);
        setCompanyTypes(response.data.Result);
      })
      .catch((e) => {
        console.log(e);
      });
  };
  useEffect(() => {
    fetchCompanies();
  }, []);
  const fetchCompanyEntity = () => {
    loanDataService
      .getEntitype()
      .then((response) => {
        console.log(response.data.Result);
        setEntityTypes(response.data.Result);
      })
      .catch((e) => {
        console.log(e);
      });
  };
  useEffect(() => {
    fetchCompanyEntity();
  }, []);
  const navigation = useNavigate();
  const updateCompanyInfo = () => {
    loanDataService
      .updateCompany(Id, company)
      .then((response) => {
        navigation("/company/1");
      })
      .catch((e) => {
        console.log(e);
      });
  };
  useEffect(() => {
    updateCompanyInfo();
  }, []);
  return (
    <>
      <button onClick={() => setToggle(!toggle)} class="btn btn-primary mb-5">
        Basic Information
      </button>
      {toggle && (
        <div>
          <form onSubmit={updateCompanyInfo}>
            <div className="grid grid-cols-1 gap-4 submit-form">
              <div className="submit-form ">
                <div className="relative center justify-center flex-1 w-full max-w-full grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
                  <TextField
                    id="Name"
                    label="Name"
                    variant="standard"
                    color="secondary"
                    size=""
                    required
                    sx={{ width: "45ch" }}
                    value={company.Name}
                    onChange={(e) =>
                      setCompany({ ...company, Name: e.target.value })
                    }
                    // onChange={handleInputChange}
                    name="Name"
                    className="w-full max-w-full"
                  />

                  <TextField
                    id="NoOfBranch"
                    label="Number Of Branch"
                    variant="standard"
                    color="secondary"
                    size=""
                    required
                    value={company.NoOfBranch}
                    onChange={(e) =>
                      setCompany({ ...company, NoOfBranch: e.target.value })
                    }
                    // onChange={handleInputChange}
                    name="NoOfBranch"
                  />
                  <TextField
                    id="EstablishmentYear"
                    label="Establishment Year"
                    variant="standard"
                    color="secondary"
                    size=""
                    required
                    value={company.EstablishmentYear}
                    onChange={(e) =>
                      setCompany({
                        ...company,
                        EstablishmentYear: e.target.value,
                      })
                    }
                    // onChange={handleInputChange}
                    name="EstablishmentYear"
                  />
                  <TextField
                    id="TINNumber"
                    label="TIN Number"
                    variant="standard"
                    color="secondary"
                    size=""
                    required
                    value={company.TINNumber}
                    onChange={(e) =>
                      setCompany({ ...company, TINNumber: e.target.value })
                    }
                    //onChange={handleInputChange}
                    name="TINNumber"
                  />
                  <TextField
                    id="TINCertificate"
                    label="TIN Certificate"
                    variant="standard"
                    color="secondary"
                    size=""
                    required
                    value={company.TINCertificate}
                    onChange={(e) =>
                      setCompany({ ...company, TINCertificate: e.target.value })
                    }
                    //onChange={handleInputChange}
                    name="TINCertificate"
                  />
                  <FormControl variant="standard" sx={{ minWidth: 120 }}>
                    <InputLabel id="CompanyType" color="secondary">
                      {" "}
                      Company Type
                    </InputLabel>
                    <Select
                      color="secondary"
                      onChange={(event) =>
                        (company.CompanyTypeID = event.target.value)
                      }
                      labelId="CompanyType"
                      id="CompanyTypeSelect"
                      // value={age}
                      label="Company Type"
                    >
                      <MenuItem value="">
                        <em>None</em>
                      </MenuItem>
                      {companyTypes.map((company) => (
                        <MenuItem key={company.Id} value={company.Id}>
                          {company.Name}
                        </MenuItem>
                      ))}
                    </Select>
                  </FormControl>

                  <TextField
                    id="VATNumber"
                    label="VAT Number"
                    variant="standard"
                    color="secondary"
                    size=""
                    required
                    value={company.VATNumber}
                    onChange={(e) =>
                      setCompany({ ...company, VATNumber: e.target.value })
                    }
                    // onChange={handleInputChange}
                    name="VATNumber"
                  />
                  <TextField
                    id="VATCertificate"
                    label="VAT Certificate"
                    variant="standard"
                    color="secondary"
                    size=""
                    required
                    value={company.VATCertificate}
                    onChange={(e) =>
                      setCompany({ ...company, VATCertificate: e.target.value })
                    }
                    //onChange={handleInputChange}
                    name="VATCertificate"
                  />
                  <FormControl variant="standard" sx={{ minWidth: 120 }}>
                    <InputLabel id="EntityTypelbl" color="secondary">
                      {" "}
                      Entity Type
                    </InputLabel>
                    <Select
                      color="secondary"
                      onChange={(event) =>
                        (company.EntityTypeID = event.target.value)
                      }
                      labelId="EntityTypelbl"
                      id="EntityTypeSelect"
                      label="Entity Type"
                    >
                      <MenuItem value="">
                        <em>None</em>
                      </MenuItem>
                      {entityTypes.map((entity) => (
                        <MenuItem
                          key={entity.Id}
                          EntityTypeListID={entity.Id}
                          value={entity.Id}
                        >
                          {entity.Name}
                        </MenuItem>
                      ))}
                    </Select>
                  </FormControl>
                </div>
                <button className="btn btn-info">Update</button>
              </div>
            </div>
          </form>
          {/* </CompanyModal> */}
        </div>
      )}
      <br />
      <button
        onClick={() => setToggleContactInfo(!toggleContactInfo)}
        class="btn btn-primary mb-5"
      >
        ContactInformation
      </button>
      {toggleContactInfo && <div>here</div>}
    </>
  );
}

export default UpdateCompany;
